  book5            plod           gender       \n"," Mode :logical   Mode :logical   Mode :logical   Mode :logical  \n"," FALSE:431       FALSE:431       FALSE:431       FALSE:431      \n"," above_avg      \n"," Mode :logical  \n"," FALSE:431      "]},"metadata":{},"output_type":"display_data"}],"source":["library(ISLR)\n","library(dplyr)\n","library(broom)\n","library(modelr)\n","library(caret)\n","library(tidyr)\n","library(mlbench)\n","library(ResourceSelection)\n","library(InformationValue)\n","library(pROC)\n","library(ggplot2)\n","library(GGally)\n","library(rpart)\n","library(lmtest)\n","library(car)\n","library(randomForest)\n","library(gbm)\n","library(tree)\n","library(ROCR)\n","library(party)\n","library(Metrics)\n","library(ipred)\n","\n","list.files(path = \"../input\")\n","\n","GoT <- read.csv(\"../input/game-of-thrones-classification-decision-tree/HW2.csv\", header = TRUE) %>% select(age, isAlive, popularity, \n","                                                     numDeadRelations, isMarried, book1, book2, \n","                                                     book3, book4, book5, plod, gender) %>% filter(age >= 0) %>% \n","mutate(above_avg = as.factor(ifelse(popularity < 0.45, \"No\", \"Yes\")))\n","\n","attach(GoT)\n","str(GoT)\n","head(GoT)\n","summary(is.na(GoT))"]},{"cell_type":"markdown","id":"bc918e3c","metadata":{"papermill":{"duration":0.058855,"end_time":"2023-08-06T20:17:09.51935","exception":false,"start_time":"2023-08-06T20:17:09.460495","status":"completed"},"tags":[]},"source":["## Introduction \n","  \n","  The first impression of Game of Thrones data is that everyone is somehow and someway either classified as married or not married. People in this dataset found a way to legitimize their road to victory. In other words, the sitting on an Iron Throne. Which is quite mind-boggling. Marrying is quite essential in the Game of Thrones universe. For military control, for alliances, for any kind of power, of course for money; people were getting married in this universe (Bechky, 2015). There would be a marrying list for the White Walkers too if their names were added to this dataset. Marrying is that vital. Speaking of White Walkers, why they weren't in this dataset? Even Night King could not enter this dataset too. He is in the books, and a legendary character/killer too ([A Wiki of Ice and Fire](https://awoiaf.westeros.org/index.php/Night_King)). They have the will the cleanse the whole Westeros. Staying alive precisely depends if there is a White Walker in this universe or not. There would be no winter discussion without the White Walkers. Some may argue that they are already dead which would be a plausible idea. However, how come they have a self-aware opinion ([Refinery29, 2017](https://www.refinery29.com/en-us/2017/08/167390/night-king-good-bad-game-of-thrones)) on how to get revenge from the Westeros if they are completely dead? So, not adding the White Walkers deserves criticism. Judging who is going to die or not is highly related to knowledge of this universe. Ignorance might be bliss (Gray, 1747), but not in the Game of Thrones. One has to know her/his enemies, and also literally has to know everything. Because one can easily die. Speaking of 'ones', Jaqen H'ghar is in the dataset. But, according to this dataset, he did not appear in any of the books. He would be a colourful character in the books too. Oh wait, he's in the books ([A Wiki of Ice and Fire](https://awoiaf.westeros.org/index.php/Jaqen_H%27ghar)) (Martin, 2005,2011,2012; Diamant, n.d). But, this dataset states that he is not. Furthermore, In TV series, he's a faceless man. In this dataset, he would be dataless man. Finding data to identify him is almost impossible. One can say; a man has to hide or a man has no data. According to this dataset, Faceless man has no relation with dead people. How to interpret this situation? He allegedly kills others, and no one knows what to know. The other option is, he does not commit anything at all. The third option would be that this dataset has no information about his businesses in Westeros. The options could be extended to extraordinary. But, guessing what happens is not necessary, and it is out of this paper's rhetoric. Anyway, this dataset has missing variables which is not a surprise anymore for anyone who is analyzing this dataset for a second time. "]},{"cell_type":"markdown","id":"f78a7fde","metadata":{"papermill":{"duration":0.061118,"end_time":"2023-08-06T20:17:09.639609","exception":false,"start_time":"2023-08-06T20:17:09.578491","status":"completed"},"tags":[]},"source":["Constructing the Model\n","\n","Date of birth has some differences in terms of having contradictory dates. Meaning, Aegon Targaryen (son\n","of Rhaegar) was born in 281 and is two years old. Also, Barra was born in 298 and is one years old. Both\n","persons’ timeline will not be the same. They will not have the same people in their environment. The person\n","is going to kill them might have died already in other person’s timeline. The examples might be extended.\n","But one is fine. Date of birth is removed from the model to avoid some above mentioned predicaments.\n","Ramsay Snow (aka Bolton) has been selected as a classifier. If one of the watchers of this show or books do\n","not know him they cannot claim that they know the show or the books yet. He can be considered as young.\n","He is married. Unlike Margaery Tyrell, he represents the other side of the Game of Thrones universe (Game\n","of Thrones Fandom). Meaning, he likes to play mind games by torturing people. He finds others’ weaknesses\n","as opposed to make an alliance with them. It is questionable that he could rule the whole Westeros. On the\n","other hand, he could be a threshold to define GoT’s realness."]},{"cell_type":"markdown","id":"9c36dec0","metadata":{"papermill":{"duration":0.059941,"end_time":"2023-08-06T20:17:09.759874","exception":false,"start_time":"2023-08-06T20:17:09.699933","status":"com