303","exception":false,"start_time":"2023-08-06T20:17:43.071467","status":"completed"},"tags":[]},"source":["The interpretation and comparisons will start with Area Under the Curves. Because previously no comments have been made about them. 77% for AUC can be stated as a good measurement for Classification Tree and Random Forest (Ludidi et. al, 2012; Tuan et. al, 2008; Jong Won & Sun Hae, 2015). As for Bagging, obtaining 1, as a result, a bit concerning one. F1 scores can help here to interpret the table. Classification Tree's and Random Forest's F1 scores are close to their AUC scores. But not on the expected level. If they had really close results they could be stated as good classifiers (Chavez-Badiola et. al, 2020). As for the misclassification rates, Random Forest has the lowest value. Overall, CT and RF could be the chosen model for this scenario while constructing the model. "]},{"cell_type":"code","execution_count":38,"id":"3f652f6d","metadata":{"execution":{"iopub.execute_input":"2023-08-06T20:17:43.307436Z","iopub.status.busy":"2023-08-06T20:17:43.305642Z","iopub.status.idle":"2023-08-06T20:17:43.334898Z","shell.execute_reply":"2023-08-06T20:17:43.333502Z"},"papermill":{"duration":0.109914,"end_time":"2023-08-06T20:17:43.335039","exception":false,"start_time":"2023-08-06T20:17:43.225125","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 3 × 4</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>AUC</th><th scope=col>Accuracy</th><th scope=col>MisclassifcationRate</th><th scope=col>F1Score</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>Classification Tree</th><td>0.5434211</td><td>0.8953000</td><td>0.104651163</td><td>0.4000000</td></tr>\n","\t<tr><th scope=row>Bagging</th><td>0.9500000</td><td>0.8833333</td><td>0.002898551</td><td>0.9473684</td></tr>\n","\t<tr><th scope=row>Random Forest</th><td>0.5000000</td><td>0.8837000</td><td>0.116279070</td><td>0.1666667</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 3 × 4\n","\\begin{tabular}{r|llll}\n","  & AUC & Accuracy & MisclassifcationRate & F1Score\\\\\n","  & <dbl> & <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\tClassification Tree & 0.5434211 & 0.8953000 & 0.104651163 & 0.4000000\\\\\n","\tBagging & 0.9500000 & 0.8833333 & 0.002898551 & 0.9473684\\\\\n","\tRandom Forest & 0.5000000 & 0.8837000 & 0.116279070 & 0.1666667\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 3 × 4\n","\n","| <!--/--> | AUC &lt;dbl&gt; | Accuracy &lt;dbl&gt; | MisclassifcationRate &lt;dbl&gt; | F1Score &lt;dbl&gt; |\n","|---|---|---|---|---|\n","| Classification Tree | 0.5434211 | 0.8953000 | 0.104651163 | 0.4000000 |\n","| Bagging | 0.9500000 | 0.8833333 | 0.002898551 | 0.9473684 |\n","| Random Forest | 0.5000000 | 0.8837000 | 0.116279070 | 0.1666667 |\n","\n"],"text/plain":["                    AUC       Accuracy  MisclassifcationRate F1Score  \n","Classification Tree 0.5434211 0.8953000 0.104651163          0.4000000\n","Bagging             0.9500000 0.8833333 0.002898551          0.9473684\n","Random Forest       0.5000000 0.8837000 0.116279070          0.1666667"]},"metadata":{},"output_type":"display_data"}],"source":["AUC <- rbind(aucDTt, aucBagT, aucRFt)\n","Accuracy <- rbind(0.8953, 0.8833333, 0.8837)\n","MisclassifcationRate <- rbind(MisRatet, MisRateBt, MisRateRFt)\n","F1Score <- rbind(F1_Regt, F1_Bagt, F1_RFt)\n","TEST <- data.frame(AUC, Accuracy, MisclassifcationRate, F1Score, stringsAsFactors = FALSE)\n","rownames(TEST) <- c(\"Classification Tree\",\"Bagging\",\"Random Forest\")\n","TEST"]},{"cell_type":"markdown","id":"ded76188","metadata":{"papermill":{"duration":0.077994,"end_time":"2023-08-06T20:17:43.491289","exception":false,"start_time":"2023-08-06T20:17:43.413295","status":"completed"},"tags":[]},"source":["For the test data sets, the Classification Tree has the highest AUC score. This time it was different from Random Forest. Speaking of Random Forest, its F1 score is very low which makes this model a bad classifier ([IBM](https://cloud.ibm.com/docs/knowledge-studio?topic=knowledge-studio-evaluate-ml)). Test results did not surpass the training results. This can be stated as a good outcome. Classification Tree's F1 score is closer than its training result. Because in the training result the gap between CT's AUC and F1 score was a bit large. \n","\n","In a nutshell, the Classification Tree can be selected as the final model. This model proved its consistency when comparing with the others. A couple of suggestions for future researchers; the first changing the popularity measure could be a good idea in terms of analyzing this data set with a different lens. The second is that other classifier might be tried. The number of dead relations could be excited to look at when it comes to understanding the Game of Thrones universe. The third one is that adding more classifier might be colourful. Meaning, popularity and being married (or not) as combined classifiers come to minds as a different approach to this data set. The fourth one, to find a better approach for misclassification rates, looking for other researchers work might be a plausible idea, for instance (Bielsa et. al, 2012; Zhou et. al, 2020). Because there could be plenty of reasons.  "]},{"cell_type":"markdown","id":"c7967d72","metadata":{"papermill":{"duration":0.078439,"end_time":"2023-08-06T20:17:43.647474","exception":false,"start_time":"2023-08-06T20:17:43.569035","status":"completed"},"tags":[]},"source":["## Bibliography\n","\n","Bechky, P. S. (2015). The International Law of Game of Thrones. Alabama Law Review Online, 67(1).\n","\n","Bielsa, S., Porcel, J. M., Castellote, J., Mas, E., Esquerda, A., & Light, R. W. (2012). Solving the Light's criteria misclassification rate of cardiac and hepatic transudates. Respirology, 17(4), 721-726.\n","\n","Chavez-Badiola, A., Farias, A. F. S., Mendizabal-Ruiz, G., Garcia-Sanchez, R., Drakeley, A. J., & Garcia-Sandoval, J. P. (2020). Predicting pregnancy test results after embryo transfer by image feature extraction and analysis using machine learning. Scientific reports, 10(1), 1-6.\n","\n","Diamant, C. De-centring Human Agency in Pop Culture: the Slave Religions of R’hllor and the Many-Faced God in A Song of Ice and Fire by George R. Martin.\n","\n","Gray, T. (1747). An ode on a distant prospect of Eton College (p. 51). London: R. Dodsley and sold.\n","\n","Jong Won, M., & Sun Hae, L. (2015). Validation of the K6/K10 scales of psychological distress and their optimal cutoff scores for older Koreans. The International Journal of Aging and Human Development, 80(3), 264-282.\n","\n","Ludidi, S., Conchillo, J. M., Keszthelyi, D., Van Avesaat, M., Kruimel, J. W., Jonkers, D. M., & Masclee, A. A. M. (2012). Rectal hypersensitivity as hallmark for irritable bowel syndrome: defining the optimal cutoff. Neurogastroenterology & Motility, 24(8), 729-e346.\n","\n","Martin, G. R. (2005). A feast for crows. Bantam.\n","\n","Martin, G. R. (2011). A dance with dragons (Vol. 5). Bantam.\n","\n","Martin, G. R. (2012). A clash of kings (Vol. 2). Bantam.\n","\n","McHugh M. L. (2012). Interrater reliability: the kappa statistic. Biochemia medica, 22(3), 276–282.\n","\n","Tuan, N. T., Adair, L. S., He, K., & Popkin, B. M. (2008). Optimal cutoff values for overweight: using body mass index to predict incidence of hypertension in 18-to 65-year-old Chinese adults. The Journal of nutrition, 138(7), 1377-1382.\n","\n","Zhou, X., Wang, X., Hu, C., & Wang, R. (2020). An analysis on the relationship between uncertainty and misclassification rate of classifiers. Information Sciences, 535, 16-27."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","n